import Link from 'next/link';
const Index = () => (
    <div>
        <ul>
            <li>
                <Link href="/"><a>Home</a></Link>
                <Link href="/about"><a>Home</a></Link>
            </li>
        </ul>
        <h1>Hello Next JS new</h1>
    </div>
);
export default Index;
